import React from "react";
import "RadioUncheckedIcon.css";
const RadioUncheckedIcon = () => {
  return (
    <svg
      aria-hidden="true"
      className="icon icon-radio-unchecked"
      xmlns="http://www.w3.org/2000/svg"
    >
      <use xlinkHref="#icon-radio-unchecked"></use>
    </svg>
  );
};

export default RadioUncheckedIcon;
